INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0001', 'Lý Hải, Quốc Cường, Trung Dũng, Huy Khánh, Thanh Thức, Trần Kim Hải', '2023-05-01 10:00:00.000000', 'Lật mặt 6 sẽ thuộc thể loại giật gân, tâm lý pha hành động, hài hước', 'Lý Hải', 132, '2023-06-09', 'Ly Hai Entertainment', 'https://media.lottecinemavn.com/Media/MovieFile/MovieImg/202304/11093_105_100010.jpg', false, 'LẬT MẶT 6: TẤM VÉ ĐỊNH MỆNH', '2023-05-01', 1, 'https://media.lottecinemavn.com/Media/MovieFile/MovieMedia/202303/11093_301_100001.mp4', '2023-05-01 10:00:00.000000', 'Phiên bản 1', 'MT-0003');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0002', 'Chris Pratt, Zoe Saldana, Dave Bautista', '2023-05-02 11:30:00.000000', 'Cho dù vũ trụ này có bao la đến đâu, các Vệ Binh của chúng ta cũng không thể trốn chạy mãi mãi. Vệ Binh Dải Ngân Hà 3 dự kiến khởi chiếu tại rạp từ 03.05.2023.', 'James Gunn', 149, '2023-06-09', 'Marvel Studio', 'https://media.lottecinemavn.com/Media/MovieFile/MovieImg/202304/11078_105_100002.jpg', false, 'VỆ BINH DẢI NGÂN HÀ 3', '2023-05-02', 1, 'https://media.lottecinemavn.com/Media/MovieFile/MovieMedia/202304/11078_301_100001.mp4', '2023-05-02 11:30:00.000000', 'Phiên bản 1', 'MT-0001');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0003', 'Vin Diesel, Jason Momoa, Brie Larson,…', '2023-05-03 14:45:00.000000', 'Dom Toretto và gia đình của anh ấy bị trở thành mục tiêu của người con trai đầy thù hận của ông trùm ma túy Hernan Reyes.', 'Louis Leterrier', 141, '2023-06-19', 'Original Film', 'https://media.lottecinemavn.com/Media/MovieFile/MovieImg/202305/11094_105_100007.jpg', false, 'FAST AND FURIOUS X', '2023-05-19', 1, 'https://media.lottecinemavn.com/Media/MovieFile/MovieMedia/202305/11094_301_100001.mp4', '2023-05-03 14:45:00.000000', 'Phiên bản 1', 'MT-0001');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0004', 'Thái Hòa, Thu Trang, Tiến Luật', '2023-05-04 16:20:00.000000', 'Lấy cảm hứng từ web drama Chuyện Xóm Tui, phiên bản điện ảnh sẽ mang một màu sắc hoàn toàn khác: hài hước hơn, gần gũi và nhiều cảm xúc hơn', 'Vũ Ngọc Đãng', 112, '2023-05-31', 'Thu Trang Entertainment', 'https://media.lottecinemavn.com/Media/MovieFile/MovieImg/202304/11053_105_100010.jpg', false, 'CON NHÓT MÓT CHỒNG', '2023-05-01', 0, 'https://media.lottecinemavn.com/Media/MovieFile/MovieMedia/202303/11053_301_100001.mp4', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0004');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0005', 'Halle Bailey, Jonah Hauer-King, Daveed Diggs, Awkwafina, Jacob Tremblay, Noma Dumezweni, Art Malik, with Javier Bardem and Melissa McCarthy', '2023-05-04 16:20:00.000000', '“Nàng Tiên Cá” là câu chuyện được yêu thích về Ariel - một nàng tiên cá trẻ xinh đẹp và mạnh mẽ với khát khao phiêu lưu. Ariel là con gái út của Vua Triton và cũng là người ngang ngạnh nhất, nàng khao khát khám phá về thế giới bên kia đại dương.', 'Rob Marshall', 135, '2023-06-30', 'Rob Marshall Entertainment', 'https://cdn.galaxycine.vn/media/2023/5/26/450x300-tien-ca_1685071817669.jpg', false, 'NÀNG TIÊN CÁ', '2023-05-26', 1, 'https://www.youtube.com/embed/R2cjgaopZcg', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0007');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0006', 'Rian Steele, Sophie Thompson, Jonathan Nyati, Jane Lowe, Phillipa Peak', '2023-05-04 16:20:00.000000', 'Trải nghiệm thời thơ ấu đau thương, Anna trở về căn nhà xưa để chăm sóc người bà ốm yếu. ', 'Jamie Hooper', 94, '2023-06-30', 'Jamie Hooper Entertainment', 'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/t/h/the_creeping_poster_700x1000_-_vie.jpg', false, 'OÁN HỒN', '2023-05-26', 1, 'https://www.youtube.com/embed/5ufiL9DL3EM', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0004');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0007', 'Lee Ha-Nee, Lee Sun-Kyun, Gong Myung, Bae Yoo-Ram, Shim Dal-Gi', '2023-05-04 16:20:00.000000', 'Âm mưu tiễn chồng về nơi chín suối đầy hài hước của nữ diễn viên tai tiếng Yeo-rae (Lee Ha-nee).', 'Lee Won-Suk', 107, '2023-06-30', 'Lee Won-Suk Entertainment', 'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/8/0/800x1000_2_.jpg', false, 'TIỄN BIỆT CHỒNG YÊU', '2023-05-26', 1, 'https://www.youtube.com/embed/bVULs93VPCQ', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0003');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0008', 'Ma Dong Seok, Lee Joon Hyuk. Munetake Aoki, Lee Beom Soo', '2023-05-04 16:20:00.000000', 'Quái vật cơ bắp Seok-do (Ma Dong Seok) dẫn đầu đội hình sự truy lùng đường dây buôn chất cấm của thiếu gia Joo Seong Cheol.', 'Lee Sang Young', 105, '2023-06-30', 'Lee Sang Young Entertainment', 'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/l/a/launching_poster-art-4x5.jpg', false, 'VÂY HÃM: KHÔNG LỐI THOÁT', '2023-06-01', 1, 'https://www.youtube.com/embed/tbZ-BmOBsuc', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0004');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0009', 'Ed Speleers, Sienna Guillory, Jeremy Irons', '2023-05-04 16:20:00.000000', 'Cậu thiếu niên Eragon ở vùng đất Alasgaesia bỗng nhiên vô tình nhặt được một viên đá lớn màu xanh kỳ lạ. Viên đá Eragon nhặt được chính là một quả trứng, nở ra cô rồng Saphira duyên dáng. ', 'Stefen Fangmeier', 104, '2023-06-30', 'Stefen Entertainment', 'https://congluan-cdn.congluan.vn/files/content/2022/04/26/john-wick-4-tung-poster-hap-dan-hua-hen-man-tro-lai-hoanh-trang-192706965.jpg', false, 'HIỆP SĨ RỒNG', '2023-05-28', 1, 'https://www.youtube.com/embed/40cepjSSomc', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0007');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0010', 'Yasamin Jasem, Tika Bravani, Arswendy Bening Swara', '2023-05-04 16:20:00.000000', 'Phim được dựa trên một vụ thảm sát thầy cúng với tà thuật đen ở Indonesia năm 1998. Chuyện phim diễn ra ở một ngôi làng tại Indonesia và hiện tượng kì lạ ở nhà cầu nguyện trong làng khi các người dân liên tục bị quấy phá khi cầu nguyện.', 'Anggy Umbara', 88, '2023-06-30', 'Anggy Umbara Entertainment', 'https://media.lottecinemavn.com/Media/MovieFile/MovieImg/202304/11053_105_100010.jpg', false, 'TIẾNG GỌI ÂM BINH', '2023-05-20', 1, 'https://media.lottecinemavn.com/Media/MovieFile/MovieMedia/202303/11053_301_100001.mp4', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0004');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0011', 'Julio Cesar, Josh Lucas', '2023-05-04 16:20:00.000000', 'Quái Vật Đen xoay quanh câu chuyện khi kỳ nghỉ bình dị của gia đình Oilman Paul Sturges biến thành cơn ác mộng. ', 'Adrian Grunberg', 100, '2023-07-31', 'Adrian Grunberg Entertainment', 'https://www.cgv.vn/media/catalog/product/cache/1/image/c5f0a1eff4c394a251036189ccddaacd/7/0/700x1000_5_.jpg', false, 'QUÁI VẬT ĐEN', '2023-06-30', 2, 'https://www.youtube.com/embed/GBh3CLB46UQ', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0001');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0012', 'Maite Perroni, Bruno Bichir', '2023-05-04 16:20:00.000000', 'Một chú gà trống dễ thương, tên là Toto, sống yên bình bên chú gà nhỏ Di của mình trong trang trại Pollón nổi tiếng. Dần dần, cả hai nảy sinh tình cảm và giờ đây, họ đã trở thành cha mẹ đáng tự hào của một cặp trứng nhỏ dễ thương tên là Uly và Max ', 'Gabriel Riva Palacio Alatriste', 112, '2023-07-09', 'Alatriste Entertainment', 'https://metiz.vn/media/poster_film/300x450_1685437021762.jpg', false, 'BÉ TRỨNG - NÁO LOẠN CHÂU PHI', '2023-06-09', 2, 'https://www.youtube.com/embed/SHvgwuxzipI', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0007');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0013', 'Sophie Thatcher, Chris Messina, Vivien Lyra Blair, Marin Ireland, Madison Hu, LisaGay Hamilton, and David Dastmalchian', '2023-05-04 16:20:00.000000', 'Từ nguyên tác truyện ngắn của bậc thầy truyện kinh dị Stephen King, “Ông Kẹ” kể về câu chuyện của gia đình Harper khi một thực thể siêu nhiên bám theo và liên tục phá rối gia đình họ.', 'Rob Savage', 98, '2023-07-31', 'Rob Savage Entertainment', 'https://metiz.vn/media/poster_film/bogym_005b_g_vie-vn_4x5__1__1.jpg', false, 'ÔNG KẸ (T16)', '2023-06-28', 2, 'https://www.youtube.com/embed/47lw43IFZps', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0004');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0014', 'Michelle Yeoh, Dominique Fishback, Ron Perlman', '2023-05-04 16:20:00.000000', 'Bộ phim dựa trên sự kiện Beast Wars trong loạt phim hoạt hình "Transformers", nơi mà các robot có khả năng biến thành động vật khổng lồ cùng chiến đấu chống lại một mối đe dọa tiềm tàng.', 'Steven Caple Jr.', 145, '2023-07-10', 'Steven Caple Entertainment', 'https://metiz.vn/media/poster_film/TRANSFORMER_MontagePoster_1080x1350.jpg', false, 'TRANSFORMERS - QUÁI THÚ TRỖI DẬY', '2023-06-10', 2, 'https://www.youtube.com/embed/CDea4ZO3OJc', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0007');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0015', 'Leah Lewis, Mamoudou Athie', '2023-05-04 16:20:00.000000', 'Xứ Sở Các Nguyên Tố từ Disney và Pixar lấy bối cảnh tại thành phố các nguyên tố, nơi lửa, nước, đất và không khí cùng chung sống với nhau. Câu chuyện xoay quanh nhân vật Ember, ', 'Peter Sohn', 99, '2023-07-28', 'Thu Trang Entertainment', 'https://metiz.vn/media/poster_film/elemental_teaser_poster_vietnam_1_.jpg', false, 'XỨ SỞ CÁC NGUYÊN TỐ', '2023-06-26', 2, 'https://www.youtube.com/embed/izi44lM_HSo', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0006');
INSERT INTO cineverse.movie (movie_id, actor, created_at, description, director, duration, end_date, film_studio, image_url, is_delete, movie_name, start_date, status, trailer_url, updated_at, version, movie_type_id) VALUES ('MV-0016', 'Hồng Ánh, Huỳnh Hạo Khang, Mai Tài Phến, Công Ninh, Hứa Vĩ Văn, Tuyền Mập, Tuấn Trần.', '2023-05-04 16:20:00.000000', 'Sau bao ngày chờ đợi, dự án điện ảnh gợi ký ức tuổi thơ của nhiều thế hệ người Việt chính thức tung hình ảnh đầu tiên đầy cảm xúc. First look poster khắc họa hình ảnh đối lập: ', 'Nguyễn Quang Dũng', 112, '2023-03-01', 'Nguyễn Quang Dũng Entertainment', 'https://metiz.vn/media/poster_film/rsz_first_look_social.jpg', false, 'ĐẤT RỪNG PHƯƠNG NAM', '2023-02-01', 0, 'https://www.youtube.com/embed/6qH81wVCH6k', '2023-05-04 16:20:00.000000', 'Phiên bản 1', 'MT-0009');
